description:
Planet Of The Apes 2011
#1-5
Boom comics
cbr


 All-new series that takes place before the original 1968 Planet of the Apes movie, set in the continuity of the first five films! An assassination tears through the fabric of both Ape and Human societies. In the chaotic aftermath, Ape forces begin arming themselves. Prepare yourself for the explosive results as Ape and Human forces clash! Covers by Karl Richardson and Chad Hardin.
